import React from 'react';
import { saveAs } from 'file-saver';
import { NavLink } from 'react-router-dom';

const SupportPage = () => {
    const handleDownload = () => {
      const fileUrl = process.env.PUBLIC_URL + '/documentation.pdf';
      FileDownload(fileUrl, 'documentation.pdf');
    };

  const handleFormSubmit = (event) => {
    event.preventDefault();
    // Function to handle the form submission
    // Add your logic to send the email
  };

  return (
    <div>
      <div className="header">Drop</div>
      <div className="logo">
        <img src="logo.png" alt="Logo" width="50" />
      </div>
      <ul className="menu">
        <li>
          <NavLink to="/">Home</NavLink>
        </li>
        <li>
          <NavLink to="/community">Community</NavLink>
        </li>
        <li>
          <NavLink to="/styleCollection">Style Collection</NavLink>
        </li>
        <li>
          <NavLink to="/support">Support</NavLink>
        </li>
      </ul>
      <div className="header">Support</div>
      <div>
        <h2>Documentation</h2>
        <button onClick={handleDownload}>Download PDF</button>
      </div>
      <div>
        <h2>Contact Us</h2>
        <form onSubmit={handleFormSubmit}>
          <label htmlFor="name">Name:</label>
          <input type="text" id="name" name="name" required />
          <label htmlFor="email">Email:</label>
          <input type="email" id="email" name="email" required />
          <label htmlFor="message">Message:</label>
          <textarea id="message" name="message" rows="4" required></textarea>
          <button type="submit">Send</button>
        </form>
      </div>
    </div>
  );
};

export default SupportPage;
